import { actionTypes } from './action';

export const initState = {
    activeQBankMainCategory : [],
    inactiveQBankMainCategory : [],
    allQBankSubCategory: [],
    totalActiveCount: 0,
    inactiveQBankSubCategory: [],
    totalInactiveCount: 0,
    waitingQuestionCountActive : [],
    activeQuestionCountActive : [],
    waitingQuestionCountInactive : [],
    activeQuestionCountInactive  : [],
    totalActiveSubCatCount : 0,
    totalInactiveSubCatCount : 0,
};

function reducer(state = initState, action) {
    switch (action.type) {
        case actionTypes.GET_ALL_QBANK_SUB_CATEGORY_SUCCESS:
            return {
                ...state,
                ...{
                    activeQBankMainCategory : action.payload && action.payload.category && action.payload.category.length > 0 ? action.payload.category : [],
                    allQBankSubCategory: action.payload && action.payload.subcategory && action.payload.subcategory.length > 0 ? action.payload.subcategory : [],
                    totalActiveCount: action.payload && action.payload.count ? action.payload.count : 0,
                    activeQuestionCountActive : action.payload && action.payload.activequestioncount && action.payload.activequestioncount.length > 0 ? action.payload.activequestioncount : [],
                    waitingQuestionCountActive : action.payload && action.payload.waitingquestioncount && action.payload.waitingquestioncount.length > 0 ? action.payload.waitingquestioncount : [],
                    totalActiveSubCatCount: action.payload && action.payload.subcategory && action.payload.subcategory.length > 0 ? action.payload.subCatCount : 0,
                },
            };
        case actionTypes.GET_INACTIVE_QBANK_SUB_CATEGORY_SUCCESS:
            return {
                ...state,
                ...{
                    inactiveQBankMainCategory : action.payload && action.payload.category && action.payload.category.length > 0 ? action.payload.category : [],
                    inactiveQBankSubCategory: action.payload && action.payload.subcategory && action.payload.subcategory.length > 0 ? action.payload.subcategory : [],
                    totalInactiveCount: action.payload && action.payload.count ? action.payload.count : 0,
                    activeQuestionCountInactive : action.payload && action.payload.activequestioncount && action.payload.activequestioncount.length > 0 ? action.payload.activequestioncount : [],
                    waitingQuestionCountInactive : action.payload && action.payload.waitingquestioncount && action.payload.waitingquestioncount.length > 0 ? action.payload.waitingquestioncount : [],
                    totalInactiveSubCatCount: action.payload && action.payload.subcategory && action.payload.subcategory.length > 0 ? action.payload.subCatCount : 0,
                },
            };
        default:
            return state;
    }
}

export default reducer;
